    /**
     * 快速排序
     **/
    @Test
    public void quickSortTest() {
        int[] test = new int[]{5, 8, 4, 1, 6, 3, 7, 9, 10, 11};
        quickSort(test, 0, 8);
        for (int i : test) {
            System.out.print(i + ",");
        }
        int index = erFenSearch(test, 100);
        System.out.println(index);
    }

    /**
     * 快速排序
     **/
    private void quickSort(int[] test, int low, int high) {
        if (low > high)
            return;

        int temp = test[low], //设置基数
                i = low, j = high;

        while (i < j) {
            while (temp < test[j] && i < j) {
                j--;
            }
            while (temp >= test[i] && i < j) {
                i++;
            }
            if (i < j) {
                int k = test[j];
                test[j] = test[i];
                test[i] = k;
            }
        }
        test[low] = test[i];
        test[i] = temp;
        quickSort(test, low, j - 1);
        quickSort(test, j + 1, high);
    }

    /**
     * 二分查找
     */
    private int erFenSearch(int[] arr, int data) {
        // 起始位
        int low = 0;
        // 结束位
        int high = arr.length - 1;
        // 中位
        int mid;

        while (low <= high) {
            mid = (low + high) / 2;
            if (arr[mid] == data) {
                return mid;
            } else if (arr[mid] < data) {
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }
        return -1;
    }

