    /**
     * CyclicBarrier测试
     **/
    @Test
    public void test09() {
        CyclicBarrier cyclicBarrier = new CyclicBarrier(3, () -> {
            System.out.println("全部到达，屏障打开了！！！");
        });
        for (int i = 1; i <= 3; i++) {
            new Thread(() -> {
                System.out.println(Thread.currentThread().getName() + "到达！");
                try {
                    cyclicBarrier.await();
                } catch (InterruptedException | BrokenBarrierException e) {
                    e.printStackTrace();
                }
            }, String.valueOf(i)).start();
        }

        try {
            TimeUnit.SECONDS.sleep(6);
        } catch (InterruptedException e) {
            e.printStackTrace();
        }
    }

    /**
     * Semaphore
     **/
    @Test
    public void test10() {
        Semaphore semaphore = new Semaphore(3);//三个资源，公平锁

        //6线程抢占三个资源
        int p = 0;
        for (int i = 1; i < 7; i++) {
            new Thread(() -> {
                System.out.println("");
                try {
                    semaphore.acquire();//抢占资源
                    System.out.println(Thread.currentThread().getName() + "抢到资源");
                    Thread.sleep(3000);
                    System.out.println(Thread.currentThread().getName() + "离开当前持有的资源");
                } catch (InterruptedException e) {
                    e.printStackTrace();
                } finally {
                    semaphore.release();//释放资源
                }
            }, String.valueOf(i)).start();

            p++;
        }

        try {
            TimeUnit.SECONDS.sleep(6);
        } catch (InterruptedException e) {
            e.printStackTrace();
        }
    }

